import React from 'react'
import {HashRouter, Route, Link} from 'react-router-dom'

export default class Home extends React.Component{
    render(){
        return (
            <HashRouter>
                <Route path="/about"></Route>
                <Route path="/topic"></Route>
            </HashRouter>
        )
    }
}
